import React from "react";
import { Link } from "react-scroll";

function Navbar() {
  return (
    <React.Fragment>
      <div className="home_page_navbar">
        <div className="ui secondary menu fixed">
          <div className="ui container">
            <Link className="logo">
              <img src="/image/grood-w.png" />
            </Link>
            <div className="right menu">
              <Link
                className="active item"
                to="what_page_background_color"
                spy={true}
                smooth={true}
                offset={0}
                duration={500}
              >
                What's Grood?
              </Link>
              <Link
                className="item"
                to="why_section"
                spy={true}
                smooth={true}
                offset={0}
                duration={500}
              >
                For Better World!
              </Link>
              <Link
                className="item listbtn"
                to="pre_order_background"
                spy={true}
                smooth={true}
                offset={0}
                duration={500}
              >
                <button className="insize ui button">Pre-Order Now</button>
              </Link>
              <img src="/image/menu.png" className="phone_menu" alt="" />
            </div>
          </div>

          <div class="ui left demo vertical sidebar labeled icon menu">
            {/* visible */}
            <Link
              className="active item"
              to="what_page_background_color"
              spy={true}
              smooth={true}
              offset={0}
              duration={500}
            >
              What's Grood?
            </Link>
            <Link
              className="item"
              to="why_section"
              spy={true}
              smooth={true}
              offset={0}
              duration={500}
            >
              For Better World!
            </Link>
            <Link
              className="item listbtn"
              to="pre_order_background"
              spy={true}
              smooth={true}
              offset={0}
              duration={500}
            >
              Pre-Order Now
            </Link>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Navbar;
